a.mean_ , pca.var_ , pca.components_ , pca.explained_variance_ , pca.explained_variance_ratio_ , pca.singular_values_ ]\n        # Submit the task graph to the scheduler\n        cpt = [ pca.explained_variance_ , pca.singular_values_]\n        explained_variance ,singular_values  = client.persist(cpt)\n        explained_variance , singular_values = client.compute([explained_variance ,singular_values])    \n        print(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1320","type":"UnionRenderers"},{"attributes":{"dimensions":"width"},"id":"1236","type":"WheelZoomTool"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{},"id":"1476","type":"BasicTickFormatter"},{"attributes":{"below":[{"id":"1292"}],"center":[{"id":"1295"},{"id":"1299"},{"id":"1334"}],"height":150,"left":[{"id":"1296"}],"renderers":[{"id":"1311"},{"id":"1340"}],"sizing_mode":"stretch_both","title":{"id":"1283"},"toolbar":{"id":"1303"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1288"},"y_range":{"id":"1286"},"y_scale":{"id":"1290"}},"id":"1282","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1231","type":"BasicTicker"},{"attributes":{},"id":"1477","type":"AllLabels"},{"attributes":{"follow":"end","follow_interval":20000,"range_padding":0},"id":"1215","type":"DataRange1d"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1277","type":"Line"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"factors":["tcp://172.21.3.113:35
